import{_ as a,o as e,c as i,e as t}from"./chunks/framework.78e651f5.js";const l="/assets/pic11.8d8b350c.jpg",r="/assets/pic3.6d16935e.jpg",o="/assets/pic4.208c4a5a.jpg",q=JSON.parse('{"title":"Мануфактура","description":"Открытая мастерская","frontmatter":{"title":"Мануфактура","description":"Открытая мастерская","date":"2019-10-16","icon":"logo.png","instagram":"manufactura_saratov","vk":"manufactura_saratov","tel":"+7-927-915-48-60","email":"kashenina-anna@yandex.ru","address":"Чапаева 59, зал 19А","city":"г. Саратов","place":"Площадь Кирова","status":"closed"},"headers":[],"relativePath":"workshop/archive/manufaktura/index.md","filePath":"workshop/archive/manufaktura/index.md"}'),s={name:"workshop/archive/manufaktura/index.md"},p=t('<p>Открытая мастерская «Мануфактура» специализируется на создании украшений и аксессуаров для дома в витражной технике Тиффани и проведении мастер-классов по данной технике. Также пространство мастерской предоставляется в аренду для проведения мастер-классов и коворкинга.</p><h3 id="о-нас" tabindex="-1">О нас <a class="header-anchor" href="#о-нас" aria-label="Permalink to &quot;О нас&quot;">​</a></h3><p>Мы сестры Аня и Катя. В 2018 году основали первую в Саратове открытую мастерскую &quot;Мануфактура&quot; для свободных мастеров города, и превратили хобби в основную работу.​​​</p><p>Мы поддерживаем людей увлеченных своим делом и хотим, чтобы наша открытая мастерская привлекала возможностью провести хорошо время в приятной атмосфере, с интересными людьми и единомышленниками.​ Мы любим ручную работу, ценим труд мастеров.​ Мы связали свою жизнь с творчеством и это всерьез и надолго!​​</p><h4 id="витражная-техника-тиффани" tabindex="-1">Витражная техника Тиффани <a class="header-anchor" href="#витражная-техника-тиффани" aria-label="Permalink to &quot;Витражная техника Тиффани&quot;">​</a></h4><p>Витражная техника Тиффани состоит из нескольких различных этапов кропотливой работы, увлекательной, местами сложной, но точно интересной.</p><p>В нашей мастерской есть все для создания изделий в витражной технике Тиффани, огромный выбор стекла: прозрачное, матовое, кремовое, яркое, рельефное, гладкого однотонное и с разводами.​</p><p><img src="'+l+'" alt=""></p><h2 id="аренда-мастерскои" tabindex="-1">Аренда мастерской <a class="header-anchor" href="#аренда-мастерскои" aria-label="Permalink to &quot;Аренда мастерской&quot;">​</a></h2><p>Стоимость аренды рабочего места без использования инструментов мастерской:</p><ul><li>100р/ч или 500р/день</li><li>Абонемент: 2000р/5 дневных посещений</li></ul><p>В стоимость аренды входит: рабочее место, использование раковины и мелких инструментов (Кисти, ножницы)​</p><p>Стоимость аренды рабочего места с любым оборудованием:</p><ul><li>200р/ч или 1000р/день</li><li>Абонемент: 3000р/5 дневных посещений</li></ul><p>В стоимость арены входит рабочее место с правом пользования всеми инструментами мастерской​</p><p><img src="'+r+'" alt=""></p><h3 id="инструменты-мастерскои​" tabindex="-1">Инструменты мастерской​ <a class="header-anchor" href="#инструменты-мастерскои​" aria-label="Permalink to &quot;Инструменты мастерской​&quot;">​</a></h3><ul><li>Швейные машинки, оверлок, утюг, пресс для кнопок и пуговиц, распарыватели, наперстки, сантиметровые ленты</li><li>Ножницы (портновские, фигурные, канцелярские) дыроколы, трафареты, штампы</li><li>Кисти, кисточки, валики​</li><li>Клеевые пистолеты​</li><li>Фены</li><li>Стеклорезы, паяльники, шлиф-машинка для витражного стекла​</li><li>Щипцы​</li><li>Рамы для батика</li><li>Удобные стулья и стол​</li><li>Раковина​</li></ul><p>Также у нас действует услуга выдачи оплаченных товаров, Стоимость хранения в течение месяца: 100 р​</p><p><img src="'+o+'" alt=""></p><h4 id="наша-мастерская-открыта-для-сотрудничества" tabindex="-1">Наша мастерская открыта для сотрудничества <a class="header-anchor" href="#наша-мастерская-открыта-для-сотрудничества" aria-label="Permalink to &quot;Наша мастерская открыта для сотрудничества&quot;">​</a></h4><p>Приходите поработать к нам, назначайте встречи со своими клиентами у нас, проводите мастер-классы, организовывайте на нашей площадки курсы и тренинги​</p><p>Приходите, красьте, лепите! Мы все за вас уберем​.</p><h3 id="аренда-полки" tabindex="-1">Аренда полки <a class="header-anchor" href="#аренда-полки" aria-label="Permalink to &quot;Аренда полки&quot;">​</a></h3><p>Стоимость аренды полки 100х40 см - 500 р/месяц плюс 10% с продажи​ Также у нас действует услуга выдачи оплаченных товаров, Стоимость хранения в течение месяца 100 р</p><h3 id="подарочные-сертификаты" tabindex="-1">Подарочные сертификаты <a class="header-anchor" href="#подарочные-сертификаты" aria-label="Permalink to &quot;Подарочные сертификаты&quot;">​</a></h3><p>Сертификат на мастер-класс или продукцию мастерской - отличный подарок для творческих личностей​</p><p>Подарочную сумму вы определяете сами, сертификат действителен 1 год</p>',28),n=[p];function c(h,d,u,_,m,f){return e(),i("div",null,n)}const b=a(s,[["render",c]]);export{q as __pageData,b as default};
